int difficulty;
int moving_speed;
int pos1;
int pos2;
int pos3;
int width1;
int width2;
int width3;
struct platform p1 = {100, 0, 0, 0xffff};
struct platform p2 = {100, 0, 0, 0xffff};
struct platform p3 = {100, 0, 0, 0xffff};
struct chess player = {10, 131, 16, 0xff00};
int press_start;
int press_duration;
int jump_distance;
int initial_distance;
bool is_pressed;
bool landed = true;
bool game_over = false;

int main(void)
{
  /* set front pixel buffer to Buffer 1 */
  *(pixel_crtl_ptr + 1) = (int)&Buffer1; // first store the address in the  back buffer
  /* now, swap the front/back buffers, to set the front buffer location */
  wait_sync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
  pixel_buffer_start = *pixel_crtl_ptr;
  clear_screen(); // pixel_buffer_start points to the pixel buffer

  /* set back pixel buffer to Buffer 2 */
  *(pixel_crtl_ptr + 1) = (int)&Buffer2;
  pixel_buffer_start = *(pixel_crtl_ptr + 1); // we draw on the back buffer
  clear_screen();                             // pixel_buffer_start points to the pixel buffer
  difficulty = 50;
  moving_speed = 5;
  pos1 = 250;
  pos2 = 150;
  pos3 = 10;
  width1 = rand() % difficulty + 10;
  width2 = rand() % difficulty + 10;
  width3 = rand() % difficulty + 10;
  p1.width = width1;
  p2.width = width2;
  p3.width = width3;
  p1.pos = pos1;
  p2.pos = pos2;
  p3.pos = pos3;

  press_start = 0;
  press_duration = 0;
  jump_distance = 0;
  initial_distance = 0;
  is_pressed = false;
  *(key_ptr + 3) = 15;
  while (1)
  {
    while (1)
    {
      clear_screen();
      draw_image(wallpaper_image_pixels, 240, 320);
      int start = *(key_ptr + 3);
      if ((start & 8) != 0)
      {
        reset_game();
        *(key_ptr + 3) = start;
        *(key_ptr) = 0;
        break;
      }
      wait_sync();
      pixel_buffer_start = *(pixel_crtl_ptr + 1);
    }

    while (1)
    {

      clear_screen();

      if (jump_distance <= 0 && landed == false)
      {
        int piece_x = 10 + initial_distance;
        if (!(is_on_platform(piece_x, p1) || is_on_platform(piece_x, p2) || is_on_platform(piece_x, p3)))
        {
          game_over = true;
        }
        else
        {
          landed = true;
        }
      }

      int key_status = *key_ptr & 0x01;
      if (key_status != 0)
      {
        if (!is_pressed)
        {
          press_start = get_time_ms();
          is_pressed = true;
        }

        int current_time = get_time_ms();
        int current_duration = current_time - press_start;
        int current_distance = current_duration / 10;
        if (current_distance > 310)
        {
          current_distance = 310;
        }

        draw_line(10, 140, 10 + current_distance, 140, 0xFB00);
      }
      else
      {
        if (is_pressed)
        {
          int press_end = get_time_ms();
          press_duration = press_end - press_start;

          jump_distance = press_duration / 10;
          initial_distance = jump_distance;

          is_pressed = false;
          landed = false;
        }
      }

      draw_platform(&p1);
      draw_platform(&p2);
      draw_platform(&p3);
      process_platform(&p1);
      process_platform(&p2);
      process_platform(&p3);

      process_player(&player);
      
      jump_distance -= moving_speed;
      if (jump_distance <= 0)
      {
        jump_distance = 0;
        player.y = 132;
      }
      

      draw_chess_piece(&player);
      if (game_over)
      {
		int key_status = *(key_ptr + 3);
		  *(key_ptr + 3) = key_status;
        break;
      }
      wait_sync();
      pixel_buffer_start = *(pixel_crtl_ptr + 1);
    }

    while (1)
    {
      clear_screen();
      show_game_over();
      int restart = *(key_ptr + 3);

      if ((restart & 2) != 0)
      {
        *(key_ptr + 3) = restart;
        break;
        // reset_game();
        // while (*key_ptr & 0x02) {}
      }

      wait_sync();
      pixel_buffer_start = *(pixel_crtl_ptr + 1);
    }
  }
}

void draw_image(const unsigned short int pixels[240][320], int h, int w)
{
  for (int i = 0; i < h; i++)
  {
    for (int j = 0; j < w; j++)
    {
      int x = j;
      int y = i;
      plot_pixel(x, y, pixels[i][j]);
    }
  }
}

void plot_pixel(int x, int y, short int line_color)
{
  if (x < 0 || x >= SCREEN_WIDTH || y < 0 || y >= SCREEN_HEIGHT)
  {
    return;
  }
  volatile short int *one_pixel_address;

  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

  *one_pixel_address = line_color;
}

void clear_screen()
{
  for (int y = 0; y < 240; y++)
  {
    for (int x = 0; x < 320; x++)
    {
      plot_pixel(x, y, 0x0000);
    }
  }
}

void wait_sync()
{
  int status;

  *pixel_crtl_ptr = 1;
  status = *(pixel_crtl_ptr + 3);
  while ((status & 0x01) != 0)
  {
    status = *(pixel_crtl_ptr + 3);
  }
}

void draw_line(int x0, int y0, int x1, int y1, short int color)
{
  int is_steep = abs(y1 - y0) > abs(x1 - x0);
  if (is_steep)
  {
    swap(&x0, &y0);
    swap(&x1, &y1);
  }
  if (x0 > x1)
  {
    swap(&x0, &x1);
    swap(&y0, &y1);
  }
  int dx = x1 - x0;
  int dy = abs(y1 - y0);
  int err = -(dx / 2);
  int y = y0;
  int y_step = 0;
  if (y0 < y1)
  {
    y_step = 1;
  }
  else
  {
    y_step = -1;
  }

  for (int x = x0; x <= x1; x++)
  {
    if (is_steep)
    {
      plot_pixel(y, x, color);
    }
    else
    {
      plot_pixel(x, y, color);
    }
    err += dy;
    if (err > 0)
    {
      y += y_step;
      err -= dx;
    }
  }
}

void swap(int *a, int *b)
{
  int temp = *a;
  *a = *b;
  *b = temp;
}

void draw_rect(int x0, int y0, int height, int width, short int color)
{
  for (int i = 0; i < height; i++)
  {
    for (int j = 0; j < width; j++)
    {
      plot_pixel(x0 + i, y0 + j, color);
    }
  }
}

void draw_platform(struct platform *p)
{
  for (int i = 0; i < p->height; i++)
  {
    for (int j = 0; j < p->width; j++)
    {
      plot_pixel(p->pos + (j - p->width / 2), SCREEN_HEIGHT - 1 - i, p->color);
    }
  }
}

int get_time_ms()
{
  static int count = 0;
  count += 30;
  return count;
}

int get_jump_height(int jump, int initial)
{
  int t0 = initial / moving_speed;
  int v = 0.3 * t0;
  int t = (initial - jump) * t0 / initial;
  return v * t - 0.3 * t * t;
  // return 0;
}

